import React from 'react'
import {
    Link, Router
} from 'react-router-dom'

const Menu = ({user, handleLogOut}) => {
    return (
        <div>
            <Link to='/'>blogs </Link>
            <Link to='/users'>users</Link>
            {user.name + ' logged in'}
            <button onClick={handleLogOut}></button>
        </div>
    )
}

export default Menu
